import React from "react";
import Link from "next/link";

export const Layout = () => {
  return (
    <React.Fragment>
      <header>
        <Link href="/">Podcast</Link>
      </header>

      <style jsx>{`
        header {
          color: #fff;
          background: #8756ca;
          padding: 15px;
          text-align: center;
        }
      `}</style>
      <style jsx global>{`
        body {
          margin: 0;
          font-family: system-ui;
          background: white;
        }
      `}</style>
    </React.Fragment>
  );
};
